import jsPDF from "jspdf";
(function(jsPDFAPI) {
  var font2 =
    "";
  var callAddFont = function() {
    this.addFileToVFS("ITC Avant Garde Gothic LT-bold.ttf", font2);
    this.addFont(
      "ITC Avant Garde Gothic LT-bold.ttf",
      "ITC Avant Garde Gothic LT",
      "bold"
    );
  };
  jsPDFAPI.events.push(["addFonts", callAddFont]);
})(jsPDF.API);
